/* Card Component Styles
 * Extracted from Brown Hack landing page design
 * Features: Clean card layout with hover effects
 */

.card {
  /* Layout */
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 1rem;
  padding: 2rem 1.5rem;

  /* Sizing */
  min-width: 280px;
  max-width: 320px;
  width: 100%;

  /* Appearance */
  background-color: #ffffff;
  border: 1px solid #e5e7eb;
  border-radius: 12px;
  box-shadow: 0 1px 3px 0 rgba(0, 0, 0, 0.1), 0 1px 2px 0 rgba(0, 0, 0, 0.06);

  /* Animation */
  transition: all 200ms ease-in-out;

  /* Interaction */
  cursor: pointer;
}

.card:hover {
  transform: scale(1.05);
  box-shadow: 0 10px 15px -3px rgba(0, 0, 0, 0.1), 0 4px 6px -2px rgba(0, 0, 0, 0.05);
  border-color: #d1d5db;
  filter: brightness(1.02);
}

.cardImage {
  /* Sizing */
  width: 80px;
  height: 80px;

  /* Appearance */
  border-radius: 8px;
  object-fit: contain;

  /* Fallback styling */
  background-color: #f3f4f6;
  padding: 1rem;
}

.cardTitle {
  /* Typography */
  font-size: 1.25rem;
  font-weight: 600;
  line-height: 1.4;
  color: #111827;

  /* Layout */
  margin: 0;
  text-align: center;

  /* Spacing */
  padding: 0;
}

.cardBody {
  /* Typography */
  font-size: 0.875rem;
  font-weight: 400;
  line-height: 1.6;
  color: #6b7280;

  /* Layout */
  margin: 0;
  text-align: center;

  /* Spacing */
  padding: 0;
}

/* Responsive adjustments */
@media (max-width: 640px) {
  .card {
    max-width: 100%;
    min-width: unset;
  }

  .cardTitle {
    font-size: 1.125rem;
  }

  .cardBody {
    font-size: 0.8125rem;
  }
}

