'use client';

import React from 'react';
import { CardCollectionProps } from './types';
import { validateCardCollection } from './utils';
import Card from './Card';
import styles from './CardCollection.module.css';

/**
 * CardCollection component that renders a collection of cards
 * Displays 5 cards in a responsive layout with hover effects
 *
 * Features:
 * - Responsive design (vertical on mobile, horizontal on desktop)
 * - Smooth hover animations (scale + brightness)
 * - Validates card data before rendering
 */
export const CardCollection: React.FC<CardCollectionProps> = ({ cards }) => {
  // Validate card data
  const validCards = validateCardCollection(cards);

  if (validCards.length === 0) {
    return (
      <div className={styles.cardCollection}>
        <p style={{ textAlign: 'center', color: '#6b7280' }}>
          No cards to display
        </p>
      </div>
    );
  }

  return (
    <div className={styles.cardCollection}>
      <div className={styles.cardGrid}>
        {validCards.map((card, index) => (
          <Card
            key={`${card.title}-${index}`}
            title={card.title}
            description={card.description}
            imageSrc={card.imageSrc}
            imageAlt={card.imageAlt}
          />
        ))}
      </div>
    </div>
  );
};

export default CardCollection;

