# Integration Guide

## Quick Start (5 minutes)

### 1. View the Demo
Navigate to this page in your Next.js app to see the component in action.

### 2. Copy Components to Your Project
Copy these files to your project:
- `Card.tsx` + `Card.module.css`
- `CardCollection.tsx` + `CardCollection.module.css`
- `types.ts`
- `utils.ts` (optional, for validation helpers)

### 3. Use in Your Page

```tsx
import CardCollection from './CardCollection';

const cards = [
  {
    title: 'Your Title',
    description: 'Your description',
    imageSrc: '/your-image.png'
  },
  // ... more cards
];

export default function YourPage() {
  return <CardCollection cards={cards} />;
}
```

## Common Use Cases

### Static Content
Use the hardcoded `MOCK_CARD_DATA` approach (current implementation).

### Dynamic Content from API
```tsx
// app/your-page/page.tsx
import { CardCollection } from './CardCollection';

async function getCards() {
  const res = await fetch('https://api.example.com/cards');
  return res.json();
}

export default async function Page() {
  const cards = await getCards();
  return <CardCollection cards={cards} />;
}
```

### CMS Integration
```tsx
// With any headless CMS (Contentful, Sanity, etc.)
import { client } from './cms-client';
import { CardCollection } from './CardCollection';

export default async function Page() {
  const cards = await client.fetch('your-query');
  return <CardCollection cards={cards} />;
}
```

## Customization Examples

### Change Number of Cards
Just modify the array - no other changes needed. The layout adapts automatically.

### Change Card Appearance
Edit `Card.module.css`:
```css
.card {
  background-color: #your-color;
  border-radius: 16px; /* rounder corners */
  padding: 3rem; /* more padding */
}
```

### Change Hover Effect
Edit `Card.module.css`:
```css
.card:hover {
  transform: scale(1.1); /* more dramatic scale */
  box-shadow: 0 20px 25px -5px rgba(0, 0, 0, 0.2); /* stronger shadow */
}
```

### Add Click Handlers
```tsx
// Wrap Card in a clickable element
<div onClick={() => handleCardClick(card)}>
  <Card {...card} />
</div>
```

## Troubleshooting

### Images Not Loading
- Check that image paths are correct and accessible from `/public/`
- Ensure Next.js Image component has proper configuration in `next.config.js`
- For external images, add domains to `next.config.js`:
  ```js
  images: {
    domains: ['your-domain.com'],
  }
  ```

### Layout Issues on Mobile
- Check that parent container doesn't have conflicting CSS
- Ensure viewport meta tag is present in your layout

### TypeScript Errors
- Ensure all required fields are present in CardData objects
- Run `npm run type-check` to validate types

## Production Checklist

- [ ] Replace placeholder images with real assets
- [ ] Update card content with real data
- [ ] Test on multiple screen sizes
- [ ] Add loading states if fetching data
- [ ] Add error boundaries
- [ ] Optimize images (WebP format, proper sizing)
- [ ] Add analytics tracking (if needed)
- [ ] Test accessibility (keyboard navigation, screen readers)
- [ ] Add SEO meta tags to page

## Need Help?

Refer to the main README.md for detailed documentation on:
- Component architecture
- Data models
- Styling approach
- Advanced customization

